class Solution:
    # 2018.10.27重新思考一下,
    # 下面的测试中仅仅包含了各种ASCII的字符
    # 最长的就应该是从字母a到字母a结束
    # 如果不是最长则,方法应该是每个字母判断一下是否出现过
    #

    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        max_length = 0
        i = 0
        common_string = ""

        # 对每一个字母开始循环
        while i <= (len(s) - 1):
            fin = 1

            if len(common_string) > 0:
                start_pos = i + len(common_string)
            else:
                start_pos = i

            # 从指定位置开始循环
            # abcddefghijk
            for c in s[start_pos:]:
                if c not in common_string:
                    # 第一个长的common 是abcd
                    common_string = common_string + c
                else:
                    # 下一个循  common 就是  bcd ,以后直接从bcd之后的字符开始看有没有新字符即可
                    max_length = len(common_string) if len(common_string) > max_length else max_length
                    common_string = common_string[1:]
                    fin = 0
                    break
            if fin != 0:
                # 如果循环完了,毫无疑问这个就是最大的了
                # 指,abbcdefg ,从第二个b开始循环,直接到结尾,那么肯定是最大的
                # 只是在abcdefghijk 这话总时,能够快一点.还可以继续优化
                max_length = len(common_string) if len(common_string) > max_length else max_length
                break
            i = i + 1
        return max_length


